import React from "react";
import linkedin from "./images/linkedin.png"
import facebook from "./images/facebook.png";
import mail from "./images/images/email.png";
import insta from "./images/instagram.png";
function footer(){
    return (
        <div className="footer">
            <div className="socials"> 
            <img src={mail} className="socials_img" alt="mail image" />
            <img src={linkedin} className="socials_img" alt="linkedin image" />
            <img src={insta} className="socials_img" alt="insta image" />
            <img src={facebook} className="socials_img" alt="facebook image" />
            </div>
        </div>
    );

}
export default footer;
